import "react";
import { useEffect } from "react";
import { Routes, Route, Link } from "react-router-dom";

import * as THREE from "three";
import { OrbitControls } from "three/examples/jsm/controls/OrbitControls";
import "./Home.css";
function Home() {
  useEffect(() => {
    const scene = new THREE.Scene();

    const camera = new THREE.PerspectiveCamera(
      75,
      window.innerWidth / window.innerHeight,
      0.1,
      1000
    );
    const canvas = document.getElementById("webgl");
    const renderer = new THREE.WebGLRenderer({
      canvas,
      antialias: true
    });

    renderer.setPixelRatio(window.devicePixelRatio);
    renderer.setSize(window.innerWidth, window.innerHeight);
    camera.position.setZ(30);
    camera.position.setX(-3);

    renderer.render(scene, camera);
    const pointLight = new THREE.PointLight(0xffffff);
    pointLight.position.set(5, 5, 5);

    const ambientLight = new THREE.AmbientLight(0xffffff);
    scene.add(pointLight, ambientLight);
    const geometry = new THREE.TorusGeometry(10, 3, 16, 100);
    const material = new THREE.MeshStandardMaterial({ color: 0xff6347 });
    const torus = new THREE.Mesh(geometry, material);
    scene.add(torus);

    // Helpers

    // const lightHelper = new THREE.PointLightHelper(pointLight)
    // const gridHelper = new THREE.GridHelper(200, 50);
    // scene.add(lightHelper, gridHelper)

    // const controls = new OrbitControls(camera, renderer.domElement);

    function addStar() {
      const geometry = new THREE.SphereGeometry(0.25, 24, 24);
      const material = new THREE.MeshStandardMaterial({ color: 0xffffff });
      const star = new THREE.Mesh(geometry, material);

      const [x, y, z] = Array(3)
        .fill()
        .map(() => THREE.MathUtils.randFloatSpread(100));

      star.position.set(x, y, z);
      scene.add(star);
    }

    Array(200).fill().forEach(addStar);

    // Background

    const spaceTexture = new THREE.TextureLoader().load(
      "data:image/png;base64,"
    );
    scene.background = spaceTexture;

    // Avatar

    const jeffTexture = new THREE.TextureLoader().load(
      "data:image/png;base64,"
    );

    const jeff = new THREE.Mesh(
      new THREE.BoxGeometry(2.7, 2.7, 2.7),
      new THREE.MeshBasicMaterial({ map: jeffTexture })
    );

    scene.add(jeff);

    // Moon

    const moonTexture = new THREE.TextureLoader().load(
      "data:image/jpg;base64,"
    );
    const normalTexture = new THREE.TextureLoader().load(
      "data:image/jpg;base64,"
    );

    const moon = new THREE.Mesh(
      new THREE.SphereGeometry(3, 32, 32),
      new THREE.MeshStandardMaterial({
        map: moonTexture,
        normalMap: normalTexture
      })
    );

    scene.add(moon);

    moon.position.z = 30;
    moon.position.setX(-10);

    jeff.position.z = -5;
    jeff.position.x = 2;

    // Scroll Animation

    function moveCamera() {
      const t = document.body.getBoundingClientRect().top;
      moon.rotation.x += 0.05;
      moon.rotation.y += 0.075;
      moon.rotation.z += 0.05;

      jeff.rotation.y += 0.01;
      jeff.rotation.z += 0.01;

      camera.position.z = t * -0.01;
      camera.position.x = t * -0.0002;
      camera.rotation.y = t * -0.0002;
    }

    document.body.onscroll = moveCamera;
    moveCamera();
    function animate() {
      requestAnimationFrame(animate);

      torus.rotation.x += 0.01;
      torus.rotation.y += 0.005;
      torus.rotation.z += 0.01;

      moon.rotation.x += 0.005;

      // controls.update();

      renderer.render(scene, camera);
    }
    animate();
  }, []);

  return (
    <div className="Home">
      <canvas id="webgl"></canvas>

      <main>
        <header>
          <div className="navbar">
            <p>
              {" "}
              Agora{" "}
              <button>
                <Link to="/Game">Enter</Link>
              </button>
            </p>
            <br />
            <br />
          </div>

          <h1>AGORA</h1>
          <p>🚀 Welcome to your own digital MetaVerse! 🥽</p>
        </header>

        <blockquote>
          <p>
            THE FIRST EVER BUILD-BASED METAVERSE RIGHT ON YOUR BROWSER,
            ACCSESIBLE ANYWHERE!
          </p>
        </blockquote>

        <section>
          <h2>📜 Our AIM:</h2>
          <p>
            PROVIDE YOU A FULL-FLEDGED METAVERSE WHERE YOU WILL COMPLETLY
            IMMERSE ONTO
          </p>

          <p>
            CHANGE THE FACE OF METAVERSES BY MAKING THE USER BUILD THIER OWN
            METAVERSE !
          </p>

          <p>M</p>
        </section>

        <section class="light">
          <h2>👩🏽‍🚀 Projects</h2>

          <p>CONTENT REQD</p>

          <h2>🏆 Accomplishments</h2>

          <p>CONTENT REQD</p>
        </section>

        <blockquote>
          <p>
            The best way out is always via the in
            <br />-
          </p>
        </blockquote>

        <section class="left">
          <h2>🌮 Work History</h2>

          <h3>fEATURES</h3>
          <p>CONTENT REQD</p>
          <h3>aBOUT</h3>
          <p>CONTENT REQD</p>
          <h3>pRICING</h3>
          <p>CONTENT REQD</p>
        </section>

        <blockquote>
          <p>Thanks!</p>
        </blockquote>
      </main>
    </div>
  );
}
export default Home;
